import React from "react"
import Highcharts from 'highcharts/highcharts-gantt.src'
import { HighchartsChart, PieSeries, Series, withHighcharts, XAxis, YAxis, Title } from "react-jsx-highcharts";
import Dashboard from  '../container/dashboard'

export function RenderPieChart({data}) {
 
  return (
      <>
    <HighchartsChart
      pie
      plotOptions={{
        pie: {
          size: 40,
          dataLabels: {
            enabled: false
          }
        }
      }}
      chart={{
        width: 100,
        height: 100,
        backgroundColor: 'transparent',
      }}
    >

      <XAxis
        id={"pie-chart-xaxis"}
      />
      <YAxis
        id={"pie-chart-yaxis"}
      >
        <Series
          type="pie"
          data={data}
        />
      </YAxis>
    </HighchartsChart>
</>
  );

}

export default withHighcharts(RenderPieChart, Highcharts);
